 final scoreline and won against both Honduras and Ecuador to qualify for the round of 16 having 6 points on the table next to group leader France. After that, in the round of 16, they drew with the Finalist Argentina and loss 0-1 to get knocked out of the tournament.</p>
<img class="aligncenter wp-image-1106" src="http://wikiceleb.com/wp-content/uploads/2018/01/Switzerland-Muslim-Football-Heroes-in-Euro-2016-300x199.jpg" alt="" width="557" height="370" />

<strong><u>World Cup Qualifier Europe</u></strong>
<p style="text-align: justify;">The World Cup qualifier in Europe selects 14 countries for the FIFA World Cup and for 2018 FIFA World Cup; Russia qualifies for being a host country. 52 countries who are the members of FIFA from Europe go for the preliminary competition where those 5 countries were divided into 9 groups in which 7 groups contain 6 teams and rest of the two groups contain only 5 teams.<a href="http://wikiceleb.com/england-road-russia-fifa-world-cup-2018/" target="_blank" rel="noopener"> England</a>,Â <a href="http://wikiceleb.com/france-road-russia-fifa-world-cup-2018/">France</a>,<a href="http://wikiceleb.com/germany-road-russia-fifa-world-cup-2018/" target="_blank" rel="noopener"> Germany</a>, Italy, Netherlands, andÂ <a href="http://wikiceleb.com/spain-road-russia-fifa-world-cup-2018/">Spain</a>Â are placed in a group containing 6 teams. Winners from each group qualify automatically and the eight best runners-up go for the playoffs from which 4 teams are selected. Thus, in this way, the Europe qualifier selects 14 nations for the FIFA World Cup.</p>
During the terminationÂ of World CupÂ qualifier Europe SwitzerlandÂ finished second on the table behind <a href="http://wikiceleb.com/portugal-road-russia-fifa-world-cup-2018/" target="_blank" rel="noopener">Portugal</a> and Switzerland managed to qualify for FIFA World Cup through Playoffs.

<img class="aligncenter wp-image-1107" src="http://wikiceleb.com/wp-content/uploads/2018/01/switzerland-goal-celebration-300x169.jpg" alt="" width="547" height="308" />

